import classes from "./Home.module.css";
import Header from "../../components/header/Header";
import Card from "../../UI/Card";
import { useDispatch } from "react-redux";
import { Fetchaction } from "../../redux/actions/Fetchaction";
import { useEffect, useState } from "react";
import { useSelector } from "react-redux";

const Home = () => {
  const dispatch = useDispatch();
  const [data,setData]=useState([]);
  useEffect(() => {
    const a=dispatch(Fetchaction());
  }, [dispatch]);

  const homedata=useSelector((state)=>state.Homeslice.item);
  setData(homedata)
  console.log(data)

  return (
    <div className={classes.homecontainer}>
      <div>
        <Header />
      </div>
      <div className={classes.homeinput}>
        <input type="text" placeholder="Search Here" />
        <button>Search</button>
      </div>
      <div className={classes.homeheading}>
        <h2>Latest News</h2>
      </div>
      <div className={classes.homecards}>
        <Card />
      </div>
    </div>
  );
};
export default Home;
